import React from 'react';
import { useHistory } from 'react-router-dom';


function App() {
  const history = useHistory();

  const redirectToNewPage = () => {
    history.push('/new-page');
  };

  return (
    <div>
      <button onClick={redirectToNewPage}>Rediriger vers une autre page</button>
    </div>
  );
}

export default App;
